function creaPdf(marca, modello , dataI ,dataF,numero, nome, cognome, totale,dalle,alle) {
    setTimeout(() => {
    var doc = new jsPDF();
    
    var img = 'data:image/jpeg;base64,';
    
    var left='data:image/jpeg;base64,';

    
    
    
    var right= 'data:image/jpeg;base64,';


    var footer = 'data:image/jpeg;base64,';
  
    

    let qrcode1 = document.getElementById('qrjs').src;
   
    doc.addImage(img, 'JPEG', 0, 0, 210,30);
    doc.addImage(left,'JPEG', 0, 30, 10.2,250);
    doc.addImage(right,'JPEG', 198.8, 30, 10.2,250);
    doc.addImage(footer,'JPEG', 0, 280, 210.2,12);
    doc.addImage(qrcode1, 'png', 150, 70, 40, 40);
    doc.addFont('Bahnschrift SemiBoldMS', 'Bahnschrift SemiBold', 'normal');
    doc.setFont('Bahnschrift SemiBold');
    doc.text(165, 115, ''+numero);
    doc.text(20,80, 'Dati Cliente:');
    doc.text(20, 100, 'Sig/Sig.ra : '+nome+' '+cognome);
    
    doc.text(20, 140, 'La tua Auto:');
      
    doc.text(20, 160, ''+marca+' '+modello);
    doc.text(20,180,'Dal '+dataI+' ore: '+dalle+' al '+dataF+' ore: '+alle);
    doc.text(20,190,'Totale = '+totale+' €');
    doc.text(20,220,'presenta questo foglio in ufficio, paga e ritira la tua auto');
    
    doc.save('prenotazione.pdf');
}, 500);
}